commonfields:
  id: Programmer
  version: -1
name: Programmer
display: Programmer
category: End point
image: data:image/jpeg;base64,
description: Programmer Life
detaileddescription: Programmer Life
configuration:
- display: Server url for programmer life
  name: serverUrl
  defaultvalue: ""
  type: 0
  required: true
script:
  script: |+
    import urllib2

    def sendRequest(method, uri, param):
        res = urllib2.urlopen(demisto.params()['serverUrl'] + uri + "?param="+param)
        if res.getcode() < 200 or res.getcode() >= 300:
            demisto.results('fail')
            sys.exit(0)
        return res.read()


    def isValid():
        return sendRequest('GET', '/', '') == 'ok';

    if demisto.command() == 'test-module':
        if isValid():
            demisto.results('ok')
        else:
            demisto.results('not ok')
    elif demisto.command() == 'pr-eat':
        demisto.results(sendRequest('GET', '/eat', demisto.get(demisto.args(), 'meal')))
    elif demisto.command() == 'pr-sleep':
        demisto.results(sendRequest('GET', '/sleep',demisto.get(demisto.args(), 'duration')))
    elif demisto.command() == 'pr-code':
        demisto.results(sendRequest('GET', '/code', demisto.get(demisto.args(), 'lang')))
    sys.exit(0)

  type: python
  commands:
  - name: pr-eat
    arguments:
    - name: meal
      required: true
      description: What to eat?
    description: Take programmer to eat something...
  - name: pr-sleep
    arguments:
    - name: duration
      required: true
      description: How much time to sleep?
    description: Take programmer to sleep...
  - name: pr-code
    arguments:
    - name: lang
      required: true
      description: Which language?
    description: Start coding!
hidden: false
